import React from 'react';
import { HashRouter as Router, Link, Route, withRouter, Switch } from 'react-router-dom';
import './home.scss';
import MenuCom from './menu';
import Patient from '../patient/patient';
import Appointment from '../appointment/appointment';
class Home extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
    };
  }
  render() {
    return (
      <div className="home">

        <Router>
          <MenuCom />
          <div className="home-header">
          </div>
          <div className="home-main">
            <Switch>
              <Route exact path="/home/" component={Patient} ></Route>
              <Route exact path="/home/patient" component={Patient} ></Route>
              <Route exact path="/home/appointment" component={Appointment} ></Route>
            </Switch>
          </div>

        </Router>
      </div>
    );
  }
}

export default withRouter(Home);
